    \begin {tikzcd}
      Ud\ar [r, "\eta _{Ud}"]\ar [dr, "1_{Ud}"'] & UFUd\ar [d, "U\epsilon _d"]\\
      & Ud
    \end {tikzcd}
    \quad \text {and}\quad 
    \begin {tikzcd}
      (UF)^2Ud\ar [r, "\mu _{Ud}"]\ar [d, "UFU\epsilon _d"'] & UFUd\ar [d, "U\epsilon _d"]\\
      UFUd\ar [r, "U\epsilon _d"'] & Ud
    \end {tikzcd}


 commute; the left is one triangle identity, while the right is
  the fact that \mu _{Ud} = U\epsilon  FUd.

